     'max_workers': 20\n    # },\n    '12_cores_with_8process': {\n        'cores': 12,\n        'memory': '32GB',\n        'processes': 8,\n        'min_workers': 20,\n        'max_workers': 30\n    }\n}\n\npopular_stocks = ['AAPL', 'GOOGL', 'MSFT', 'AMZN']\nresults = {}\n\nfor config_name, params in slurm_configs.items():\n    print(f\"\\nTesting SLURM {config_name} configuration:\")\n    start_time = time.time()\n    \n    \n    try:\n        \n        world_size = params['cores'] * params['processes'] * params['max_workers']\n        job_script_prologue = [\n            'export MASTER_ADDR=$(hostname)',\n            'export MASTER_PORT=29500',\n            f'export WORLD_SIZE={world_size}',\n            'export LOCAL_RANK=${SLURM_LOCALID}',\n            f'export RANK=$((SLURM_NODEID * {params[\"processes\"]} + SLURM_LOCALID))'\n        ]\n        \n        # Create cluster with remaining parameters\n        cluster = SLURMCluster(\n            queue='courses',\n            walltime='01:00:00',\n            death_timeout=60,\n            nanny=True,\n            cores=params['cores'],\n            memory=params['memory'],\n            processes=params['processes'],\n            job_script_prologue=job_script_prologue,\n            worker_extra_args=[\"--lifetime\", \"55m\", \"--lifetime-stagger\", \"4m\"],\n        )\n        \n        \n        cluster.adapt(minimum=params['min_workers'], maximum=params['max_workers'])\n        \n        # Create client and run computation\n        client = Client(cluster)\n\n        display(HTML(f\"&lt;a href='{client.dashboard_link}'&gt;Dask Dashboard&lt;/a&gt;\"))\n        print(f\"Dashboard link: {client.dashboard_link}\")\n        print(f\"Cluster status: {client.status}\")\n        \n        scaling_logger = ScalingLogger(logger)\n        client.register_plugin(scaling_logger)\n        \n        with performance_report(filename=f\"performance_report_cnn_{config_name}.html\"):\n            predictions, actuals = main(popular_stocks)\n        \n        print(\"Main Function Done..!\")\n        \n        execution_time = time.time() - start_time\n        \n        scheduler_info = client.scheduler_info()\n        workers = scheduler_info.get('workers', {})\n        \n        results[config_name] = {\n            'execution_time': execution_time,\n            'configuration': params,\n            'scaling_jobs': len(workers),\n        }\n        \n        print(f\"Configuration: {config_name}\")\n        print(f\"Execution time: {execution_time:.2f} seconds\")\n        \n    except Exception as e:\n        print(f\"Error with configuration {config_name}: {str(e)}\")\n        results[config_name] = {'error': str(e)}\n        \n\n# Print results summary\nprint(\"\\nResults Summary:\")\nfor config, result in results.items():\n    if 'error' in result:\n        print(f\"{config}: Error - {result['error']}\")\n    else:\n        print(f\"{config}: {result['execution_time']:.2f} seconds\")\n        print(f\"Configuration: {result['configuration']}\")\n        print(f\"Scaling jobs: {result['scaling_jobs']}\")\n    print(\"-\" * 50)\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1499","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p1141","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p1139","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p1140","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p1151"},"y_scale":{"type":"object","name":"LinearScale","id":"p1152"},"title":{"type":"object","name":"Title","id":"p1144","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1181","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1136","attributes":{"selected":{"type":"object","name":"Selection","id":"p1137","attributes
